CREATE DATABASE IF NOT EXISTS electrical_parts;
USE electrical_parts;

-- Roles
CREATE TABLE roles (
    role_id INT PRIMARY KEY AUTO_INCREMENT,
    role_name VARCHAR(50) UNIQUE NOT NULL,
    role_description VARCHAR(255)
) ENGINE=InnoDB;

-- Users
CREATE TABLE users(
    user_id INT PRIMARY KEY AUTO_INCREMENT,
    username VARCHAR(100) NOT NULL,
    email VARCHAR(100) UNIQUE NOT NULL,
    userrole ENUM('internal', 'external') NOT NULL,
    company VARCHAR(100) NOT NULL,
    role_id INT,
    FOREIGN KEY (role_id) REFERENCES roles(role_id) ON DELETE CASCADE
) ENGINE=InnoDB;

-- no access from mobile app full crud from web
CREATE TABLE auth(
    auth_id INT PRIMARY KEY AUTO_INCREMENT,
    username VARCHAR(100) NOT NULL,
    email VARCHAR(100) UNIQUE NOT NULL,
    password VARCHAR(255) NOT NULL,
    user_id INT,
    FOREIGN KEY (user_id) REFERENCES users(user_id) ON DELETE SET NULL
) ENGINE=InnoDB;

-- Ship Owner
CREATE TABLE ship_owner (
    owner_id INT PRIMARY KEY AUTO_INCREMENT,
    owner_name VARCHAR(100) NOT NULL,
    owner_email VARCHAR(100) NOT NULL
) ENGINE=InnoDB;

-- Ships
CREATE TABLE ships (
    ship_id INT PRIMARY KEY AUTO_INCREMENT,
    ship_name VARCHAR(100) NOT NULL,
    ship_type VARCHAR(100) NOT NULL,
    designspec VARCHAR(100),
    owner_id INT NULL, 
    imo_no VARCHAR(100) NOT NULL,
    FOREIGN KEY (owner_id) REFERENCES ship_owner(owner_id) ON DELETE SET NULL
) ENGINE=InnoDB;

-- Ship Engines
CREATE TABLE ship_engine (
    engine_id INT PRIMARY KEY AUTO_INCREMENT,
    engine_type VARCHAR(100) NOT NULL,
    engine_cylinders VARCHAR(100) NOT NULL,
    engine_no VARCHAR(100) NOT NULL,
    internal_engine_id VARCHAR(100) NOT NULL,
    ship_id INT NULL,
    owner_id INT NULL,
    FOREIGN KEY (ship_id) REFERENCES ships(ship_id) ON DELETE SET NULL,
    FOREIGN KEY (owner_id) REFERENCES ship_owner(owner_id) ON DELETE SET NULL
) ENGINE=InnoDB;

-- Junction Box
CREATE TABLE junction_box (
    junction_box_id INT PRIMARY KEY AUTO_INCREMENT,
    item_id VARCHAR(200),
    junction_box_type VARCHAR(200),
    junction_box_description VARCHAR(200)
) ENGINE=InnoDB;

-- Components
CREATE TABLE components (
    component_id INT PRIMARY KEY AUTO_INCREMENT,
    component_name VARCHAR(100),
    component_description VARCHAR(500),
    item_id VARCHAR(100),
    component_type VARCHAR(100),
    pos_no VARCHAR(100),
    maker VARCHAR(100),
    ref_id_name VARCHAR(100),
    quantity VARCHAR(100),
    engine_id INT NULL,
    junction_box_id INT NULL,
    FOREIGN KEY (engine_id) REFERENCES ship_engine(engine_id) ON DELETE SET NULL, 
    FOREIGN KEY (junction_box_id) REFERENCES junction_box(junction_box_id) ON DELETE SET NULL 
) ENGINE=InnoDB;

-- User Documentation
CREATE TABLE user_documentation (
    user_documentation_id INT PRIMARY KEY AUTO_INCREMENT,
    documentation_description VARCHAR(500),
    user_id INT NULL,
    junction_box_id INT NULL,
    FOREIGN KEY (user_id) REFERENCES users(user_id) ON DELETE SET NULL, 
    FOREIGN KEY (junction_box_id) REFERENCES junction_box(junction_box_id) ON DELETE SET NULL 
) ENGINE=InnoDB;

-- Picture User Documentation
CREATE TABLE picture_user_documentation (
    picture_id INT PRIMARY KEY AUTO_INCREMENT,
    picture_data LONGBLOB NOT NULL,
    picture_filename VARCHAR(255),
    picture_mimetype VARCHAR(100),
    user_documentation_id INT NULL,
    FOREIGN KEY (user_documentation_id) REFERENCES user_documentation(user_documentation_id) ON DELETE SET NULL 
) ENGINE=InnoDB;

-- Manuals
CREATE TABLE manuals (
    manual_id INT PRIMARY KEY AUTO_INCREMENT,
    manual_name VARCHAR(200),
    version VARCHAR(100),
    manual_component INT NULL,
    manual_junction_box INT NULL,
    ships INT NULL,
    FOREIGN KEY (manual_component) REFERENCES components(component_id) ON DELETE SET NULL,
    FOREIGN KEY (manual_junction_box) REFERENCES junction_box(junction_box_id) ON DELETE SET NULL,
    FOREIGN KEY (ships) REFERENCES ships(ship_id) ON DELETE SET NULL
) ENGINE=InnoDB;

-- Manual PDF Files
CREATE TABLE manual_pdf_files (
    id INT AUTO_INCREMENT PRIMARY KEY,
    manual_id INT NOT NULL,
    file_name VARCHAR(255) NULL,
    file_data LONGBLOB NULL,
    FOREIGN KEY (manual_id) REFERENCES manuals(manual_id) ON DELETE CASCADE
) ENGINE=InnoDB;




